  return(
    <>
    <Props   imgsrc={values.imgsrc}
            title={values.title}
            text={data[0].text}
            btn={data[0].btn}
             />

    </>
  )
}

function App() {


  return (
    <div className="App">
      <>
        <div className='container my-5'>
          <div className='row'>



          {data.map(allData)}


          </div>
        </div>



      </>
    </div>
  );
}

export default App;
